import React, {useState} from "react";

const Request = () => {

    const [url, setUrl] = useState(`http://localhost:8081/getAllCourses`)
    fetch(url)
        .then(result => result.json())
//         .then(data => console.log(data))
        .catch(error => console.log(error))
}

export default Request;
